import React from 'react'
import '../styles/hazara.css';
function Hazara() {
  return (
    <div>
      <button>Haripur</button>
      <button>Gallies</button>
      <button>Kaghan</button>
      <button>Siran</button>
      <button>Hazara Tribe</button>
      <button>Tor Ghar</button>
      <button>Agror Tanawla</button>
    </div>
  )
}

export default Hazara;
